  return (
    <div className="image-home">
      <img src={image1} alt="" />
      <div className="content">
        <h1>PLAY NOW, PAY LATER</h1>
        <p>
          Easy Pre-Approved Online Financing Available On All Systems For
          Qualifying Customers
